import React, { Component } from "react";

import UserService from "../services/user.service";

export default class Pricing extends Component {

  constructor(props) {
    super(props);

    this.state = {
      content: ""
    };
  }

  componentDidMount() {
    UserService.getPublicContent().then(
      response => {
        this.setState({
          content: response.data
        });
      },
      error => {
        this.setState({
          content:
            (error.response && error.response.data) ||
            error.message ||
            error.toString()
        });
      }
    );
  }

  render() {


    return (


<div id="parent">


<video controls>
<source src="d1npt7ns5uaxtu.cloudfront.net/clip1.mp4" type="video/mp4"/>
</video>


</div>
    );
  }
}
